  border: 1px solid white;
  width: 50%;
`;

const StyledTableRow = styled.tr`
  width: 500px;
`;

const StyledTableData = styled.td`
  border: 1px solid white;
`;

function SinglePokemonInfo(props) {
  console.log(props.name);
  return (
    <div>
      <h2>{props.name}</h2>
      <img src={props.imgPath} />
      <StyledPokemonTable>
        <tr>
            <td></td>
        </tr>
      </StyledPokemonTable>
    </div>
  );
}

export default SinglePokemonInfo;
